import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Footer = () => {
	return (
		<footer>
			<Container>
				<Row>
					<Col className="footer-links">
						<ul></ul>
					</Col>
				</Row>
				<Row>
					<Col className="text-center py-3"> Copyright &copy; Poshak </Col>
				</Row>
			</Container>
		</footer>
	);
};

export default Footer;
